void checkTestType()
{
    InventTestTable inventTestTable = InventTestTable::find(inventTestGroupMember.TestId);
    PdsBatchAttrib  pdsBatchAttrib  = PdsBatchAttrib::find(inventTestGroupMember.PdsBatchAttribId);
    boolean         isOption        = inventTestTable.TestType == InventTestType::Option;

    inventTestGroupMember_ds.object(fieldNum(InventTestGroupMember,StandardValue)).enabled(!isOption);
    inventTestGroupMember_ds.object(fieldNum(InventTestGroupMember,LowerLimit)).enabled(!isOption);
    inventTestGroupMember_ds.object(fieldNum(InventTestGroupMember,UpperLimit)).enabled(!isOption);
    inventTestGroupMember_ds.object(fieldNum(InventTestGroupMember,LowerTolerance)).enabled(!isOption);
    inventTestGroupMember_ds.object(fieldNum(InventTestGroupMember,UpperTolerance)).enabled(!isOption);
    inventTestGroupMember_ds.object(fieldNum(InventTestGroupMember,VariableId)).enabled(isOption);
    inventTestGroupMember_ds.object(fieldNum(InventTestGroupMember,VariableOutcomeIdStandard)).enabled(isOption);
    inventTestGroupMember_ds.object(fieldNum(InventTestGroupMember,TestUnitId)).enabled(!isOption);
    inventTestGroupMember_ds.object(fieldNum(InventTestGroupMember,PdsBatchAttribId)).enabled(inventTestTable.RecId != 0);
}

